            height: 16px;
            margin-inline-start: -8px;
            content: "";
            display: block;
            transform: rotate(45deg);
            transform-origin: 50% 50%;
            border-block-end: 1px solid #ccc;
            border-inline-end: 1px solid #ccc;
            z-index: 56;
            background-color: #fff;
